import React from "react";
import ReactDOM from "react-dom";
import { Link } from "react-router"
import "./index.css";

import { Provider } from "react-redux"
import store from "./store/store"

ReactDOM.render(
  <Provider store={store}>
    <React.StrictMode>
      <Link></Link>
      <h1>OMDB</h1>
    </React.StrictMode>
  </Provider>,
  document.getElementById("root")
);
